(function(){'use strict'; window.front_page_app=window.front_page_app||angular.module('frontPageApp',['angular-responsive','ui.router','ngAnimate'],function($interpolateProvider){$interpolateProvider.startSymbol('[[');$interpolateProvider.endSymbol(']]');}); window.front_page_app.value('GLOBAL_VALUES',{EMAIL:'gogistics@gogistics-tw.com'}); window.front_page_app.config(function(responsiveHelperProvider,$stateProvider,$urlRouterProvider){ var device=responsiveHelperProvider.$get().isMobile()?'mobile':'desktop'; $stateProvider.state('home',{templateUrl:'/my_ng_templates/my_ng_template_base.html',}).state('front_page',{url:'/',parent:'home',templateUrl:'/my_ng_templates/my_ng_front.html',controller:'frontPageDispatchCtrl'});$urlRouterProvider.otherwise('/');}); var frontPageDispatchController=function($state,$scope,GLOBAL_VALUES){$scope.email=GLOBAL_VALUES.EMAIL;$state.transitionTo('front_page');};frontPageDispatchController.$injector=['$state','$scope','GLOBAL_VALUES'];window.front_page_app.controller('frontPageDispatchCtrl',frontPageDispatchController);})();